import axios from 'axios';

// Assurez-vous que cette URL correspond à l'URL configurée dans votre backend Symfony
const API_URL = 'http://10.60.136.91:8000/api/produits';  // Adresse IP locale correcte

export const fetchProducts = async () => {
  try {
    const response = await axios.get(API_URL);
    return response.data;  // Retourne les données pour utilisation dans les composants
  } catch (error) {
    console.error('Error fetching products:', error);
    throw error;  // Relance l'erreur pour la gestion externe
  }
};
import React, { useState } from 'react';
import { Text, View, Button, Alert } from 'react-native';

export default function App() {
  const [error, setError] = useState(null);

  const handleFetchData = async () => {
    try {
     const response = await axios.get(API_URL);
    return response.data;  // Retourne les données pour utilisation dans les composants
    } catch (error) {
      setError(error.message);
      console.error('Une erreur s\'est produite :', error);
    }
  };

  return (
    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      {error && <Text style={{ color: 'red' }}>{error}</Text>}
      <Button title="Fetch Data" onPress={handleFetchData} />
    </View>
  );
}
